/*Lms Back to Top Button Function Start*/
$(document).ready(function(){ 
    $(window).scroll(function(){ 
        if ($(this).scrollTop() > 1200) { 
            $('.scroll-btn').fadeIn(); 
        } else { 
            $('.scroll-btn').fadeOut(); 
        } 
    }); 


    // $(function() {
    //     $('.scroll-btn').click(function() {
    //       if (location.pathname.replace(/^\//,'') == this.pathname.replace(/^\//,'') && location.hostname == this.hostname) {
    //         var target = $(this.hash);
    //         target = target.length ? target : $('[name=' + this.hash.slice(1) +']');
    //         if (target.length) {
    //           $('html,body').animate({
    //               //the 205 is a fixed header offset
    //             scrollTop: target.offset().top - 0
    //           }, 1000);
    //           return false;
    //         }
    //       }
    //     });
    //   });

    $('.round').click(function(e) {
        e.preventDefault();
        e.stopPropagation();
        $('.arrow').toggleClass('bounceAlpha');
        $("html, body").animate({ scrollTop: 0 }, 600); 
        return false; 
    });


    $(function() {
        $('.lms-element-nav li a').click(function() {
          if (location.pathname.replace(/^\//,'') == this.pathname.replace(/^\//,'') && location.hostname == this.hostname) {
            var target = $(this.hash);
            target = target.length ? target : $('[name=' + this.hash.slice(1) +']');
            if (target.length) {
              $('html,body').animate({
                  //the 205 is a fixed header offset
                scrollTop: target.offset().top - 100
              }, 1000);
              return false;
            }
          }
        });
      });

      const swiper = new Swiper('.lms-testimonial-slider .swiper-container', {
        slidesPerView: 1,
        spaceBetween: 0,
        pagination: {
            el: '.swiper-pagination',
            type: 'bullets',
        },
        navigation: {
            nextEl: ".swiper-button-next",
            prevEl: ".swiper-button-prev",
        },
        breakpoints: {
          320: {
            slidesPerView: 1,
            spaceBetween: 0
          },
          
          480: {
            slidesPerView: 1,
            spaceBetween: 0
          },
          
          640: {
            slidesPerView: 1,
            spaceBetween: 0
          }
        }
      })

      const swiper = new Swiper('.lms-library-slider .swiper-container', {
        slidesPerView: 4,
        spaceBetween: 0,
        pagination: {
            el: '.swiper-pagination',
            type: 'bullets',
        },
        navigation: {
            nextEl: ".swiper-button-next",
            prevEl: ".swiper-button-prev",
        },
        breakpoints: {
          320: {
            slidesPerView: 1,
            spaceBetween: 0
          },
         
          480: {
            slidesPerView: 1,
            spaceBetween: 0
          },
          
          640: {
            slidesPerView: 4,
            spaceBetween: 0
          }
        }
      })
});
/*Lms Back to Top Button Function End*/